public class MultiplexprogramFactory(string resourceName = null, Action<Humidifier.MediaLive.Multiplexprogram> factoryAction = null) : ResourceFactory<Humidifier.MediaLive.Multiplexprogram>(resourceName)
{

    internal List<InnerMultiplexprogramMultiplexProgramPipelineDetailFactory> PipelineDetailsFactories { get; set; } = [];

    internal InnerMultiplexprogramMultiplexProgramPacketIdentifiersMapFactory PacketIdentifiersMapFactory { get; set; }

    internal InnerMultiplexprogramMultiplexProgramSettingsFactory MultiplexProgramSettingsFactory { get; set; }

    protected override Humidifier.MediaLive.Multiplexprogram Create()
    {
        var multiplexprogramResult = CreateMultiplexprogram();
        factoryAction?.Invoke(multiplexprogramResult);

        return multiplexprogramResult;
    }

    private Humidifier.MediaLive.Multiplexprogram CreateMultiplexprogram()
    {
        var multiplexprogramResult = new Humidifier.MediaLive.Multiplexprogram
        {
            GivenName = InputResourceName,
        };

        return multiplexprogramResult;
    }
    public override void CreateChildren(Humidifier.MediaLive.Multiplexprogram result)
    {
        base.CreateChildren(result);

        result.PipelineDetails = PipelineDetailsFactories.Any() ? PipelineDetailsFactories.Select(x => x.Build()).ToList() : null;
        result.PacketIdentifiersMap ??= PacketIdentifiersMapFactory?.Build();
        result.MultiplexProgramSettings ??= MultiplexProgramSettingsFactory?.Build();
    }

} // End Of Class

